import { Box, Flex, HStack, Text } from "@chakra-ui/react";
import { DragHandleIcon } from "@chakra-ui/icons";

const HabitItem = ({ habitData }) => {
	return (
		<HStack spacing="2" alignItems="center">
			<DragHandleIcon />
			<Text>{habitData.title}</Text>
		</HStack>
	);
};

export default HabitItem;
